import React from "react"

import ChatBar from "../components/ChatBar"
import MesPanel from "../components/MesPanel"



const Messanger = () => {

	return (
		<div className="ChatPage">
			<ChatBar />
			<MesPanel />
		</div>
	)
}

export default Messanger
